final perceptron = Perceptron.fromJson(jsonData);

final width = 768;
final height = 495;

final widthRes = 763;
final heightRes = 490;

final rand = Random();

void main(List args) async {
  final bytes = File('keanu.png').readAsBytesSync();
  final image = decodeImage(bytes);
  var imgres = Image(widthRes, heightRes);
  imgres = fillRect(imgres, 0, 0, widthRes, heightRes, 0xFFFFFFFF);
  for (var i=0; i<heightRes-4; i+=4) {
    for (var j=0; j<widthRes-4; j+=4) {
      final input = <double>[];
      for (var y=0; y<7; y++) {
        for (var x=0; x<7; x++) {
          input.add((image.getPixel(j+x, i+y)%256)/256);
        }
      }
      final result = perceptron.process(input);
      var angle = getAngle(result);
      var lumi = 1 - (input.reduce((a, b) => a + b) / 49);
      if (angle == null) {
        if (lumi > 0.4) {
          angle = 60;//rand.nextDouble() * 180;
          lumi = lumi/8;
        }
        else {
          continue;
        }
      }
//      else {
//        if (result[3] > 0.5) {
//          lumi = 1;
//        }
//        else {
//          lumi = result[3];
//        }
//      }
      final strokeLen = (lumi * 4);
      final centerX = j+3;
      final centerY = i+3;
      final startX = centerX + strokeLen * cos(angle / pi);
      final startY = centerY + strokeLen * sin(angle / pi);
      final endX = centerX + strokeLen * cos(angle / pi + pi);
      final endY = centerY + strokeLen * sin(angle / pi + pi);
      imgres = drawLine(imgres, startX.toInt(), startY.toInt(), endX.toInt(), endY.toInt(), 0xFF000000);
//      print(angle);
    }
    print('y = $i');
  }
  File('result.png').writeAsBytesSync(encodePng(imgres));
}

double getAngle(List<double> input) {
  if (input[3] < 0.15) {
    return null;
  }
  final ranged = input.getRange(0, 3).toList();
  final minimum = ranged.reduce(min);
  for (var i=0; i<3; i++) {
    if (ranged[i] == minimum) {
      ranged[i] = 0;
      break;
    }
  }
  var sum = 0.0;
  ranged.forEach((n) => sum+=n);
  for (var i=0; i<3; i++) {
    if (ranged[i] != 0) {
      ranged[i] = ranged[i]/sum;
    }
  }
//  print(ranged);
  return convertOutputToAngle(ranged.toList());
}